import React from 'react';


const Image = (props) => {
    return(
        <>

            <div className="img">
                {(() => {
                    if (()=>props.toggle() === true) {
                        return <span>true</span>
                    } else {
                        return <span>false</span>
                    }
                })()}
            </div> 
        </>
    )
};
export default Image;
